import React from "react";
import logo from "../../../public/assets/b08aff5e2618461bbc31fbdadb00508f.png";

const Header = () => {
  return (
    <div>
      <div>
        <img>Logo</img>
        <p>Login</p>
        <p>Cart Img</p>
      </div>
      <input></input>
    </div>
  );
};

export default Header;
